    function mint(
        address _to,
        uint256 _id,
        uint256 _quantity,
        bytes memory _data
    ) public override(ERC1155Tradable) onlyOwner {
        if (_id < 1 || _id > 2) {
            revert IncorrectBoxId(_id);
        }

        if (totalSupply(_id) + _quantity > typeCaps[_id]) {
            revert BoxCapped(_id);
        }

        ERC1155Tradable.mint(_to, _id, _quantity, _data);
